	SET NOCOUNT ON;

	SELECT AD.SectionID
		,AD.TestContent
		,AD.ID
		,SC.SectionName
	FROM [aut].[AutomationData] AD WITH (NOLOCK)
	INNER JOIN [aut].[AutomationDataSections] SC ON AD.SectionID = SC.SectionID
