/****** Object:  StoredProcedure [aut].[usp_GetQueueById]    Script Date: 09-07-2025 19:15:34 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [aut].[usp_GetQueueById]
    @QueueId NVARCHAR(150)
AS
BEGIN
    SET NOCOUNT ON;

    -- Handle empty string inputs by setting them to NULL
    IF @QueueId = ''
    BEGIN
        SET @QueueId = NULL;
    END

    -- Retrieve the queue by ID only if it is provided
    IF @QueueId IS NOT NULL
    BEGIN
        PRINT 'Fetching queue by ID';

        SELECT 
            [QueueId],
            [TagName],
            [EmpId],
            [QueueName],
            [QueueDescription],
            [ProductLine],
            [QueueStatus],
            [CreatedDate],
            [Id],
            [LibraryName],
            [ClassName],
            [MethodName]
        FROM [aut].[QueueInfo] WITH (NOLOCK)
        WHERE QueueId = @QueueId;
    END
    ELSE
    BEGIN
        PRINT 'Queue ID is required';
    END
END;
GO
